import React from 'react';

const About = () => {
	return (
		<div className=" ui container ">
			<div>
				<h1 className="ui huge header">Sarah Brackett</h1>
			</div>
			<div className="ui list">
				<div className="item">
					<div className="ui header large">
						Professional
					</div>
					<div>
						Number one
					</div>
					<div>
						Number two
					</div>
				</div>
			</div>


		</div>
	);
};

export default About;
